import React from 'react';
import Square from './Square.js'

const Board = ({squaresList}) => {
    const createGrid = () => {
        for(i=0; i<9;i++) {
            return(
                <Square id={squaresList[i].id}/>
            )
        }
    }
    return(
        <div className='game-board-container'>
            <div className='squares-container'>
                {createGrid}
            </div>
        </div>
    )
}

export default Board;
